import styled from "styled-components";
import { motion } from "framer-motion";

const NavbarFiveColsStyle = styled(motion.div)`
  position: absolute;
  width: 500px;
  background-color: crimson;
  height: auto;
  padding: 20px;
  cursor: auto;
  display: flex;
  justify-content: space-between;
  .section {
    display: flex;
    flex-direction: column;
    background-color: darkviolet;
    * {
      cursor: auto;
      margin-bottom: 10px;
    }
    .cover {
      background-color: ivory;
      height: 500px;
      width: auto;
    }
  }
`;

const NavbarFiveCols = ({ controller }) => {
  return (
    <NavbarFiveColsStyle animate={controller}>
      <div className="section">
        <span className="cover" />
        <span className="title"> Company </span>
        <span>Katz</span>
        <span>Livefish</span>
        <span>Digitube</span>
        <span>Midel</span>
        <span>Rhyloo</span>
        <span>Innojam</span>
      </div>
      <div className="section">
        <div className="cover" />
        <span className="title"> Company </span>
        <span>Katz</span>
        <span>Livefish</span>
        <span>Digitube</span>
        <span>Midel</span>
        <span>Rhyloo</span>
        <span>Innojam</span>
      </div>
      <div className="section">
        <div className="cover" />
        <span className="title"> Company </span>
        <span>Katz</span>
        <span>Livefish</span>
        <span>Digitube</span>
        <span>Midel</span>
        <span>Rhyloo</span>
        <span>Innojam</span>
      </div>
      <div className="section">
        <div className="cover" />
        <span className="title"> Company </span>
        <span>Katz</span>
        <span>Livefish</span>
        <span>Digitube</span>
        <span>Midel</span>
        <span>Rhyloo</span>
        <span>Innojam</span>
      </div>
    </NavbarFiveColsStyle>
  );
};

export default NavbarFiveCols;
